from multiprocessing import Pool

example = 'dabAcCaCBAcCcaDA'
input = ''


def day5_1(inp):
    inp = list(inp)
    prev = None
    while prev != len(inp):
        prev = len(inp)
        for i in range(1, len(inp)):
            a = inp[i-1]
            b = inp[i]
            # print(a, b, ord(a), ord(b), ord(a) ^ ord(b))
            if ord(a) ^ ord(b) == 32:
                # print(a, b)
                del inp[i], inp[i-1]
                # print(''.join(inp))
                break

    return len(''.join(inp))


def day5_2(inp):
    print("Original", inp)
    inp = [inp.replace(letter, '').replace(letter.upper(), '')
           for letter in set(inp.lower())]
    with Pool() as p:
        return min(p.map(day5_1, inp))


if __name__ == '__main__':
    # print(day5_1(example))
    # print(day5_1(input))
    print(day5_2(example))
    print(day5_2(input))
